export default {
  computed: {
    layout: function layout() {
      if (this.$page.path) {
        var layout = this.$page.frontmatter.layout;

        if (layout && (this.$vuepress.getLayoutAsyncComponent(layout) || this.$vuepress.getVueComponent(layout))) {
          return layout;
        }

        return 'Layout';
      }

      return 'NotFound';
    }
  }
};
